        <td>{e.age}</td>
        <td>{e.address}</td>
        <td>
          <Link href="/clients/[id]" as={`/clients/${e._id}`}>
            <a>Go to client</a>
          </Link>
        </td>
      </tr>
    ));
    return tableClients;
  };

  export default ClientsList;
